import React from "react";

const NoteForm = (props) => {
    const {formTitle, userName, firstName, lastName, status, titleChanged, contentChanged, submitClicked, submitText} = props;

    return (
        <div>
        <h2>{formTitle}</h2>
        <div className="grid">
          <input
            type="text"
            name="title"
            className="form-input mb-30"
            placeholder="userName"
            value={userName}
            onChange={titleChanged}
          />
<input
            type="text"
            name="title"
            className="form-input mb-30"
            placeholder="firstName"
            value={firstName}
            onChange={contentChanged}
          />
          <input
            type="text"
            name="title"
            className="form-input mb-30"
            placeholder="lastName"
            value={lastName}
            onChange={titleChanged}
          />
          <input
            type="text"
            name="title"
            className="form-input mb-30"
            placeholder="status"
            value={status}
            onChange={titleChanged}
          />
  

          <a href="#" className="button green" onClick={submitClicked}>
            {submitText}
          </a>
        </div>
      </div>
    )
}

export default NoteForm
